import React from "react";
import "./App.css";
import Header from "./components/Header";

const Body: React.FC = () => {
  function counter() {
    return <h1>hello</h1>;
  }
  return (
    <>
      <div className="body">
        <form>
          <div>
            <div className="title titleInline">Restaurant name:</div>
            <input id="resName" className="resName" type="text" name="restaurant" />
          </div>
          <div>
            <div className="title">Review:</div>
            <textarea className="comment" name="comment"></textarea>
          </div>
          <div>
            <div className="title titleInline">Ranting:</div>
            <input className="stepper" type="number" value="3" id="points" name="points" width="20" step="1" />
          </div>
          <div className="addBtnGroup">
            <button type="submit" value="Submit">Save</button>
            <button type="reset" value="Reset">Cancel</button>
            <button>Delete</button>
          </div>
        </form>
      </div>
    </>
  );
};

const App: React.FC = () => {
  return (
    <div className="body">
      <Header />
      <Body />
    </div>
  );
};

export default App;
